script: |
  super -f text -I q8310.spq | sort > q8310.out

inputs:
  - name: q8310.spq
    data: |
      SELECT - col2 * col2 FROM tab0 (FORMAT parquet) WHERE NOT - col1 / 17 - - col2 BETWEEN col2 AND ( ( + col2 ) ) + col1;
  - name: tab0

outputs:
  - name: q8310.out
    data: |
      -100
      -2209
